import { useAuth } from "../context/AuthContext.js";
import { useNavigate } from "react-router-dom";
function Nav() {
  const navigate = useNavigate();
  const { user, logout } = useAuth();
  const handleLogOut = async () => {
  await logout();
  navigate("/");
};

  const handleHome = () =>{navigate("/home");}
  const handleFavorite = (id) =>{

    navigate("/favoritos", {state: {id}})

  return (
    <>
      <header className="fixed top-0 h-[90px] w-full bg-black/70 z-50">
        <nav className="h-full">
          <div className="flex items-center justify-center h-full">
            <div className="flex items-center justify-between w-full px-28">
              <span className="text-3xl hover:cursor-pointer  h-[90px] w-[250px]" onClick={handleHome}>
                <img width={250} height={90} alt="" src="/PELISUNCP.webp"/>
              </span>
              <div className="flex gap-4 items-center text-white font-semibold">
                <span>Bienvenido, {user?.name}</span>
                <span>
                  <button
                    className="bg-white text-red-600 font-bold px-6 py-1 rounded border-2 border-red-600 hover:bg-white/90"
                    onClick={()=>handleFavorite(user?.id)}
                  >
                    Favoritos
                  </button>
                </span>
                <span>
                  <button
                    className="bg-red-600 text-white border-2 border-white/60 px-6 py-1 rounded hover:bg-red-800"
                    onClick={handleLogOut}
                  >
                    SALIR
                  </button>
                </span>
              </div>
            </div>
          </div>
        </nav>
      </header>
    </>
  );
}
}
export default Nav;
